INSERT INTO `mdt_reports` (`id`, `char_id`, `title`, `incident`, `charges`, `author`, `name`, `date`, `jailtime`) VALUES
	(110, 20514, 'Danny J.', 'Danny Johnson was on MRPD property for no reason at all so i was going to give him loitering charges but when i checked his record he has no license to drive and i saw him driving a hermes. Then he resisted and took off in his car and evaded the police. He was ramming our vehicle and endangering everyone. He also threatened to shoot officers. \n\nOfficers involved: 166 N.Anderson and 194 J.Burg', '{"Attempted Murder of a Peace Officer":3,"Assault":1,"Loitering":1,"Possession of Class 2 Weapon":1,"Driving without a License":1,"Reckless Endangerment":1,"Felony Evasion":2}', 'Kevin Herron', 'Danny Johnson', '11-25-2020 13:33:20', 175),
	(111, 20418, 'Lost Mc Raid', 'Name was given when raid happend at lost MC club house. Was told by Lorenzo that he is a known Lost Member', '{"Possession Of A PD Weapon":2,"Drug Distribution/Intent to Distrubute - Class 1":2,"Possession of Class 3 Firearm":10,"Possession of Class 2 Weapon":13,"Possession of Weapon Attachment":2}', 'Kevin Herron', 'Gizmo DavenPort', '11-25-2020 15:03:14', 318),
	(112, 20515, 'Lost Mc Raid', 'Name was given when raid happend at lost MC club house. Was told by Lorenzo that he is a known Lost Member', '{"Possession Of A PD Weapon":2,"Drug Distribution/Intent to Distrubute - Class 1":2,"Possession of Class 3 Firearm":10,"Possession of Class 2 Weapon":13,"Possession of Weapon Attachment":2}', 'Kevin Herron', 'Diego Garcia', '11-25-2020 15:04:30', NULL),
	(113, 20394, 'Lost Mc Raid', 'Name was given when raid happend at lost MC club house. Was told by Lorenzo that he is a known Lost Member', '{"Possession Of A PD Weapon":2,"Drug Distribution/Intent to Distrubute - Class 1":2,"Possession of Class 3 Firearm":10,"Possession of Class 2 Weapon":13,"Possession of Weapon Attachment":2}', 'Kevin Herron', 'Dominic Lepipion-J-Lau', '11-25-2020 15:05:09', NULL),
	(114, 20417, 'Lost Mc Raid', 'Name was given when raid happend at lost MC club house. Was told by Lorenzo that he is a known Lost Member', '{"Possession Of A PD Weapon":2,"Drug Distribution/Intent to Distrubute - Class 1":2,"Possession of Class 3 Firearm":10,"Possession of Class 2 Weapon":13,"Possession of Weapon Attachment":2}', 'Kevin Herron', 'Bjorn Erikson', '11-25-2020 15:05:38', NULL),
	(115, 20417, 'Lost Mc Raid', 'Name was given when raid happend at lost MC club house. Was told by Lorenzo that he is a known Lost Member', '{"Possession Of A PD Weapon":2,"Drug Distribution/Intent to Distrubute - Class 1":2,"Possession of Class 3 Firearm":10,"Possession of Class 2 Weapon":13,"Possession of Weapon Attachment":2}', 'Kevin Herron', 'Bjorn Erikson', '11-25-2020 15:06:44', NULL),
	(116, 20395, 'Search Warrant', '166. N Anderson 165. k Herron 101. C Miller 194. J Burg. We were trying to get a Danny Johnson in custody for a warrant that had been placed out for his arrest. Offier\'s attempted to stop Danny as him and Lorenzo Lurk took off and headed for the tunnels. As they were down in the tunnels they opened fire on Law Enforcement with AP Pistols, they continued down the tunnels as we lost eyes. About 15 minutes later a Hermes was spotted at Pillbox Medical, We then tried to stop the vehicle as it matched the description as the vehicle that shot in the tunnels. The vehicle took off again about 1 minute later the the driver 10-50 and was shot down. Law Enforcement took the driver to Pillbox and then took him to MRPD to get charged. Then a comet was also spotted matching the description of the one that was also down in the tunnels. There were 2 occupants in the vehicle one of them including Lorenzo Lurk as he was then shot down Lorenzo was then taken to Pillbox and was treated for GSW\'S. When we arrived at MRPD we were then notified that he had a search warrant out for his arrest. When we searched Lorenzo he did not have the AP Pistol on him so we proceed to ask him were it was at, he then told us it was in the MC Club House. After this we then raided Lorenzo\'s Vehicles and then his integrity way apartment. Then we went to the MC Club and raided them due to the fact Lorenzo admitted that that\'s where the AP was at. After raiding the MC we then brought everything back to MRPD and placed it into the evidence locker. Lorenzo Lurk was then fined 220 thousand  and was sent to prison for 1868 Months.', '{"Drug Distribution/Intent to Distrubute - Class 1":2,"Possession of Class 2 Weapon":13,"Possession of Class 3 Firearm":10,"Possession of Weapon Attachment":2,"Possession of Stolen Goods":100}', 'John Burg', 'Lorenzo  Lurk', '11-25-2020 16:29:17', 1868),
	(117, 20505, '(Arrest) 11/26/2020', '163 was attempting a 10-38 on a revolta, it ended up taking off from us. after a long active 10-80. the revolta blew up. we took the 95 down to pillbox for medical treatment. and he was arrested for felony evasion.\n\nOfficers involved: 163 Cappin, 191 Lucinao ', '{"Felony Evasion":1}', 'Leon Cappin', 'Ty Jones', '11-26-2020 19:17:57', 20),
	(118, 20767, '(Arrest) 11/28/2020', 'Plead guilty to shooting officers at legion, and pillbox also having a class 2 heavy pistol.', '{"Possession of Class 2 Weapon":1,"Attempted Murder of a Peace Officer":3}', 'Leon Cappin', 'Ian Toggle', '11-27-2020 20:18:48', 60),
	(119, 20705, '(Arrest) Lewis Rayz 11/28/2020', 'Plead guilty, to shooting officers at legion and pillbox. also having a pd weapon.', '{"Possession Of A PD Weapon":1,"Attempted Murder of a Peace Officer":3}', 'Leon Cappin', 'Lewis Rayz', '11-27-2020 20:29:35', 60),
	(120, 20552, '(Arrest) Coe Jones 11/28/2020', 'Pleaded guilty to shooting for no reason.', '{"Unlawful Discharge of a Firearm":1}', 'Leon Cappin', 'Coe Jones', '11-27-2020 20:45:30', 10),
	(121, 20396, 'Danny Ron- Robbing a store', 'hgf', '{"Fleeing & Eluding":1,"Attempted Armed Roberry":1}', 'Callum King', 'Danny Ron', '11-29-2020 14:32:58', 23),
	(122, 20420, '(Warrant)Juan Carlos De Casa 11/29/2020', 'Indivual was being arrested by 183, he broke out of custody and robbed 183. After stealing a pd vehicle he evaded us twice. He was ID\'d by 183 before he made the arrest.  ', '{"Felony Evasion":2,"Possession of a stolen vehicle":1,"Escaping Custody":1,"False Imprisonment":1}', 'Leon Cappin', 'Juan CarloseDeCasa', '11-29-2020 18:08:39', 77),
	(123, 20396, '(Arrest) Danny Ron 11/30/2020', 'Plead guilty to shooting at peace officers and felony evading. ', '{"Felony Evasion":1,"Attempted Murder of a Peace Officer":2}', 'Leon Cappin', 'Danny Ron', '11-30-2020 15:35:48', 70),
	(124, 20586, '(Active Warrant) Bobby Jimmy 11/30/2020', '****ACTIVE WARRANT****\n\nEvaded from us in his white incolored golf, and brandished a weapon without a weapon licsense. ', '{"Felony Evasion":1,"Possession of Illegal Firearm":1}', 'Leon Cappin', 'Bobby Jimmy', '11-30-2020 16:47:50', 40),
	(125, 20393, '(Arrest) Josh LeClair 11/30/2020', 'Plead Guilty to kidnapping, assault with a deadly, and Possession of a class 2. ', '{"Assault with Deadly Firearm":2,"Possession of Class 2 Weapon":1,"Kidnapping":1}', 'Leon Cappin', 'Josh LeClair', '11-30-2020 18:16:20', 40),
	(126, 20578, 'Chodman Kidnapping Officer', 'PENDING', '{"Attempted Murder of a Peace Officer":1,"Possession of Class 2 Weapon":1,"Drug Paraphernalia":1,"Kidnapping":1}', 'Carson Miller', 'Alfie Chodman', '11-30-2020 18:20:11', 56),
	(127, 20586, 'Jimmy Kidnapping Police Officer', 'It started out at legion square bank were Bobby and 3 other individuals took officer 163 Cappin hostage. It \nlead in a chase for about 4 minutes were they decided to stop at a house other wise known as Michael\'s house. We started negotiations to try to get the officer back into police custody for about 10 minutes we negotiated. We got the officer back into police custody, soon after we open fired on 4 vehicles that left the scene. That lead into a huge gunfight throughout the vinewood hills. All suspects were neutralized and taken to the hospital for further treatment by the one and only Nancy. \n\n-----------------------------------------------------------------------------------------------------------\n\nOfficers involved:\n101 Chief\n163 L. Cappin\n191 M. Luciano\n120 K. Herron\n110 L. Moretti\n160 S. Walker\n\n-----------------------------------------------------------------------------------------------------------\n\nEvidence found on suspect:\n\nhttps://imgur.com/9GZHsM8\n\n', '{"Possession of Class 1 Weapon":1,"Possession of Illegal Firearm":1,"Attempted Murder of a Peace Officer":1,"Felony Evasion":1,"Kidnapping":1}', 'Carson Miller', 'Bobby Jimmy', '11-30-2020 18:24:11', 88),
	(128, 20392, 'Turner Kidnapping Police Officer', 'pending', '{"Attempted Murder of a Peace Officer":1,"Possession of Class 1 Weapon":1,"Possession of Contraband":1,"Kidnapping":1}', 'Carson Miller', 'Timmy Turner', '11-30-2020 18:27:02', 56),
	(129, 20396, 'Search Warrant', 'Name: Danny Ron\nDate: 30/11/20\nTime: 2045\nCharges: \nAttempted Murder x5 of a LEO\nPossession of Class 3\nKidnapping of Leo\nFelony Evading\n_\nRobbed multiple Class 2 and 2 pd ars\n \nOrders: If caught then Police Force may search vehicles and properties owned by wanted fugitives. \nAlso only to procure stolen items from robbery (if present), Class 2, and Class 3 Weapons including any ammo.', '{"Possession of Class 3 Firearm":1,"Attempted Murder of a Peace Officer":6,"Kidnapping":1,"Possession of Class 1 Weapon":3,"Felony Evasion":1,"Possession of Class 2 Weapon":7}', 'Kevin Herron', 'Danny Ron', '12-02-2020 13:00:25', 281),
	(130, 20606, 'Myles Corruption', 'PENDING', '{"Corruption":1,"Impersonation of a Government Official":1,"Aiding & Abetting of a Felony":4,"Attempted Murder of a Peace Officer":1}', 'Carson Miller', 'Travis Myles', '12-04-2020 14:23:19', 97),
	(131, 20395, '6Str Robbery of Bank', 'Officer Dingle Stone was undercover and infiltrated the 6str  gang, caught them in the middle of the bank robbery. Gerald and Lorenzo were the main suspects.Took BobbyJimmy Hostage.', '{"Attempted Armed Roberry":1,"Felon in Possession of a Firearm":2,"Kidnapping":1}', 'Dingle Stone', 'Lorenzo  Lurk', '12-04-2020 16:23:37', 20),
	(132, 20598, '6Str Robbery of Bank', 'Officer Dingle Stone was undercover and infiltrated the 6str  gang, caught them in the middle of the bank robbery. Gerald and Lorenzo were the main suspects.Took BobbyJimmy Hostage.', '{"Attempted Armed Roberry":1,"Felon in Possession of a Firearm":2,"Possession of Explosives":1,"Kidnapping":1}', 'Kevin Herron', 'Gerald Finkelberg', '12-04-2020 16:30:11', 24),
	(133, 20606, 'Kidnapping Sgt. Herron', 'Kidnapped Sgt. Herron from in front of pillbox. Carved a penis in his chest and left notes in his pockets.', '{"Attempted Murder of a Peace Officer":1,"Kidnapping":1}', 'Kevin Herron', 'Travis Myles', '12-04-2020 18:56:20', 20),
	(134, 20435, 'Kidnapping Sgt. Herron', 'Kidnapped Sgt. Herron from in front of pillbox. Carved a penis in his chest and left notes in his pockets.', '{"Attempted Murder of a Peace Officer":1,"Possession of Class 2 Weapon":1,"Kidnapping":1}', 'Kevin Herron', 'Herb Escobar', '12-04-2020 18:57:39', 20);
